import "./ContentList.css";

function ContentList({ contents }) {
  const onClickTitle = () => {
    console.log("타이틀이 클릭되었다!");
    setClickTitle(true);
  };
  return (
    <div className="ContentList">
      <div className="content__item">
        {contents.map((el, idx) => (
          <li className="contents__list" key={idx}>
            <div className="username">{el.username}</div>
            <div className="title" onClick={onClickTitle}>
              {el.title}
            </div>
            <div className="createAt">{el.createdAt}</div>
          </li>
        ))}
      </div>
    </div>
  );
}

export default ContentList;
